// This function will be used to convert images to base64
// You can pre-convert your logo and paste the base64 string directly
// or use this function to convert it at runtime

export const getBase64Image = async (imagePath: string): Promise<string> => {
  // In production, you might want to pre-convert your images
  // and just import the base64 string directly
  try {
    const response = await fetch(imagePath);
    const blob = await response.blob();
    return new Promise((resolve) => {
      const reader = new FileReader();
      reader.onloadend = () => resolve(reader.result as string);
      reader.readAsDataURL(blob);
    });
  } catch (error) {
    console.error('Error converting image to base64:', error);
    return '';
  }
};

// Pre-converted base64 string for your logo (replace with your actual base64 string)
// You can get this by running the above function in the browser console
// or using an online image to base64 converter
export const LOGO_BASE64 = "data:image/png;base64,";